import React, { Component } from 'react';
import Link from 'next/link';


class Index extends Component {
    render() {
        return (
            <div>
                <Link href="/about">
                    <a>About Page</a>
                </Link>
                <Link href="/nested-page/first">
                    <a>Nested page</a>
                </Link>

                <Link href="/dynamic-page/:slug">
                    <a>Nested page</a>
                </Link>


               <h1 align="center">I am home page</h1>
            </div>
        );
    }
}

export default Index;
